import { Link } from "react-router-dom";

import { StyledHero } from "../styles/StyledHero";

const Home = () => {
  return (
    <StyledHero>
      <div className="hero-container">
        <div className="hero-content"></div>
        <h1>WANNA CATCH SOME POKEMONS?</h1>
      </div>
    </StyledHero>
  );
};

export default Home;
